import React from 'react'
import Navbar from "./Navbar"

const Main = () => {
  return (
    <div>
       <Navbar/>
      <h1>Main</h1>
      <button onClick={handleAuctioneerClick}>Auctioneer</button>
      <button onClick={handleBidderClick}>Bidder</button>
    </div>
  )
}

export default Main
